      <Row title="Action Movies" fetchUrl={requests.fetchActionMovies} />
      <Row title="Comedy Movies" fetchUrl={requests.fetchComedyMovies}/>
      <Row title="Romance Movies" fetchUrl={requests.fetchRomanceMovies} />
      <Row title="Horror Movies" fetchUrl={requests.fetchHorrorMovies} /> 
      <Row title="Documentaries" fetchUrl={requests.fetchDocumentaries} />
      <footer>
        <h2>Footer</h2>
        <p>The  tag in HTML is used to define a footer of HTML document. This section contains the footer information (author information, copyright information, carriers, etc). The footer tag is used within the body tag. The  tag is new in the HTML5. The footer elements require a start tag as well as an end tag.</p>
          <a href="https://www.geeksforgeeks.org/about/">About Us</a>|
          <a href="https://www.geeksforgeeks.org/privacy-policy/">Privacy Policy</a>|
          <a href="https://www.geeksforgeeks.org/careers/">Careers</a>
           <p>@geeksforgeeks, Some rights reserved</p>
      </footer>
    </div>
  );
}

export default App;
